                <p style="text-align: center; font-weight: bold;">"దాత వ్యమితి యద్దానం దీయతే నుపకారినే , దేశే కాలేచ పాత్రే చ, తత్ దానం సాత్విక0 స్మృ తం"  - భగవద్గీత 17 వ అధ్యాయం</p>

                కులమతాల కు అతీతంగా, యోగ్యులయిన పేద కుటుంబం లకు, నిష్కామంగా, ఏమీ ఆశించకుండా 	అర్హులైన వారికి చేసే విధాన దానమే నిజమైన దానం జగద్గురు శ్రీ కృష్ణుడు చెప్పినది.
                <br /><br />
                ప్రస్తుత దేశ రాష్ట్ర పరిస్థితి అందరికీ విదితమే. మానవ సహజ వికృతాలపై ప్రకృతి ఎత్తిన కొరడా " కరోనా మహమ్మారి".  "మేము సైతం " ప్రజా జఠరాగ్ని ని ఆర్పుటలో "చేయూత" నిస్తామని ఎప్పుడూ ముందుండే మన VYSPRO ఇండియా ఇప్పుడు కూడా మన పాత్ర పోషించడానికి ముందుకొచ్చింది.
                కొందరికైనా సాయం చేద్దాం అని అందరూ అనుకుంటే అందరికీ సాయం అందుతుంది.
                <br /><br />
                మన సంస్థ తరపున "భారత మాత" సంతతిలో కొందరికైనా, మన " వాసవి మాత" సంతతి ద్వారా "చేయూత" ను ఇద్దా మనే సత్ సంకల్పం తో మనలో కొందరికి వచ్చిన ఆలోచనా రూపమే " దీన జన భోజన( ప్ర) యోజన". కొన్ని కుటుంబాలను కుల మతప్రాతిపదిక లేకుండా ఒక్క మాసం గ్రాసం, సుమారు 2500/- రూపాయల విలువైన బియ్యం, పప్పు ఉప్పు లు, పచారీ దినుసులు May నెల లో నిర్దుష్ట కమిటీ ద్వారా గుర్తించి,  అందజేయాలని ఈ పథకం రూప కల్పన చేయడం జరిగింది.
